テラリウム用の保温球やライトの使用に適しており、150Ｗ球までご使用可能です。<Br>
照射方向を自由に設定していただくため、<Br>
角度調節・回転可能な設計となっています。<Br>
さらに、付属の固定用ビスを使用して、網ケージなどに直接固定することが可能です。<Br>
<FONT SIZE="3" COLOR="#FF8C00">※角度調節後は各間接部をマイナスドライバーにて固定する必要があります。</FONT><Br><Br>
<FONT SIZE="4" COLOR="#FF8C00"><B>付属の固定用ビスが付いたのでしっかり固定できます。</B></FONT><Br><FONT SIZE="3" COLOR="#FF6347"><B>
簡単取付けで、中間スイッチ付!!<br>
優れた耐熱性！<br>
広い照射範囲！<br>
コンパクト設計！</b></FONT><br>
<Br>
●クリップ式で取り付けが超簡単！<br>
●角度も自在でお好みの照射方向に設定可能です。<br>
●ケージに直接設置できるように、固定用ビスを付属しました。<br>
●150Wまでのテラリウム用ライト/保温球がご使用できます。<br><Br>
キーワード：爬虫類の保温　保温電球ソケット　ビバリア　スポットランプ<br>
レプロケージ　バスキング　リクガメ<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

