ひまわりは、爬虫類や両生類に使用できる強力クリップ付きの保温球スタンドです。照射角度を上下左右自由に変えられます。クリップを取り外してフタ等にネジ止めも可能です。また、カバーの側面と後方に放熱孔を多数設けました。中間スイッチ付き。<BR><BR>【ひまわり仕様】<BR>口金：E26<BR>定格電圧…100V　電源コード長…約2m　適用電灯…150wまで<BR><BR>メーカー：みどり商会<BR><BR>
シャトル　やけど防止ネットは、樹上生物(カメレオン・トカゲ・ヘビ等)飼育の必需品です。シャトルは長年宇宙服に使用された耐熱耐火のやわらかい特殊素材で熱をほとんど持ちません。爬虫類の生体自体にも必要ですが、飼い主さん自身のメンテナンス時のやけど防止に役立ちます。<BR><BR>※使用電球は、150w以下、もしくは電球表面温度が270度以上にならない範囲でご使用下さい。<BR><BR>メーカー：みどり商会<br><br>
キーワード：爬虫類ケージ　爬虫類ヒーター　保温カバー　保温球ソケット<br>
　　　　　　　　　　　　　ケースバイケース　カメレオン　イグアナ　トカゲ<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

